import './App.css';
import { Route } from 'react-router-dom'
import Home from './pages/Home'
import Projects from './pages/Projects'

const App = () => {
  return (
    <div className="App">
      <Route path ="/" component = {Home} />
      <Route path ="/project/:id" component = {Projects} />
    </div>
  );
};

export default App;
